            status: "unseen"
        },
        {
            patientId: 3,
            patientName: "Jagadeesh",
            symptom:"cold",
            status: "unseen"
        }
    ]);
    return (
        <>
            <h1>Today's Appoinment</h1>
            <div>
            <table>
                <thead>
                    <th>Slot No</th>
                    <th>Patient Id</th>
                    <th>Patient Name</th>
                    <th>Symptoms</th>
                    <th>Status</th>
                </thead>
                <tbody>
                    {
                        details.map((det)=>
                        <tr>
                            <td>patientId</td>
                            <td>patientName</td>
                            <td>Symptom</td>
                            <td>status</td>
                        </tr>)
                    }
                </tbody>
            </table>
            </div>
        </>
    );
}

export default DoctorAppoinment;
